private final int fillDocs(int size) throws IOException {
  final IndexInput freqIn = this.freqIn;
  final int docs[] = this.docs;
  int docAc = accum;
  for (int i = 0; i < size; i++) {
    docAc += freqIn.readVInt();
    docs[i] = docAc;
  }
  accum = docAc;
  return size;
}

